> Entertainment Cory Wells, Three Dog Night singer, dies in New York at 74 This Dec. 6, 2008 photo provided by Three Dog Night shows singer-musician, Cory Wells, performing on stage with Three Dog Night at Primm Valley Resort, in Primm, Nevada. Wells, a founding member of the popular 1970s band Three Dog Night and lead singer on such hits as "Never Been to Spain" and "Mama Told Me (Not to Come)," has died at age 74. Wells experienced acute back pain weeks ago and died suddenly Tuesday, Oct. 20, 2015, in Dunkirk, where he had lived, bandmate Danny Hutton said. (Jerry Gallegos/Three Dog Night via AP) 
